import './App.css';
import  {useState} from 'react'
import React from 'react';
//import axios from "axios";
import {FormLabel,Box,Input,HStack,FormControl,
Center} from "@chakra-ui/react";
//import Rad from './button';

const App = () => {

  const [name, setName] = useState('');
  const[cpf,setCpf]= useState('')
  const [dataN, setDataN] = useState('');
  const [naturalidade, setNaturalidade] = useState('');
  const [celular, setCelular] = useState('');
  const [telefone, setTelefone] = useState('');
  const [endereço,setEndereço] = useState('');
  const [cidade,setCidade] = useState('');
  const [value, setValue] = useState('Masculino'); 



 const handleSexoChange = (newValue) => {
  setValue(newValue);
};

    const handleSubmit = (e) => {
      e.preventDefault(); // Prevent default form submission behavior
      console.log('Form submitted');
    };
  function btnFunction() {
    axios.post('http://localhost:8000/forms', {
      name, cpf,dataN,naturalidade,celular,
      telefone,endereço,cidade,sexo  

    })
      .then(response => {
        console.log(response);
      })
      .catch(error => {
        console.log(error);
      });
  }

  return (
    <div className="container">
    <div className="container-login">
    <div className="wrap-login">
       <form  >

      <Center
                as="header"
                h={50}
                w={430}
                bg="#f29ef3"
                color="white"
                fontWeight="bold"
                fontSize="4xl"
                pb="8"
              >
                <h2>Formulário</h2>
              </Center><br></br>
      <FormControl display="flex" flexDir="column" gap="4">
      <HStack spacing="4">
              <Box w="100%">
                <FormLabel htmlFor="nome">Nome Completo</FormLabel>
                <Input id="nome" type="nome" 
                onChange={e => setName(e.target.value)}
                />
              </Box>
              <Box w="100%">
                <FormLabel htmlFor="cpf">Cpf</FormLabel>
                <Input id="cpf" 
                 onChange={e => setCpf(e.target.value)}
                />
              </Box>
            </HStack>
      <HStack spacing="4">
              <Box w="100%">
                <FormLabel htmlFor="nasc">Data de Nascimento</FormLabel>
                <Input id="nasc" type="date"
                 onChange={e => setDataN(e.target.value)}
                 />
              </Box>
              <Box w="100%">
                <FormLabel htmlFor="natural">Naturalidade</FormLabel>
                <Input id="natural" 
                 onChange={e => setNaturalidade(e.target.value)}
                />
              </Box>
            </HStack>
            <HStack spacing="4">
              <Box w="100%">
                <FormLabel htmlFor="cel">Celular</FormLabel>
                <Input id="cel" type="number"
                 onChange={e => setCelular(e.target.value)}
                 />
              </Box>
              <Box w="100%">
                <FormLabel htmlFor="Tefone">Telefone</FormLabel>
                <Input id="Tefone" type="number"
                 onChange={e => setTelefone(e.target.value)}
                 />
              </Box>
            </HStack>
            <HStack spacing="4">
              <Box w="100%">
                <FormLabel htmlFor="endereco">Endereço</FormLabel>
                <Input id="endereco" 
                 onChange={e => setEndereço(e.target.value)}
                />
              </Box>
              <Box w="100%">
                <FormLabel htmlFor="cidade">Cidade</FormLabel>
                <Input id="cidade"
                 onChange={e => setCidade(e.target.value)} 
                />
              </Box>
            </HStack>
      </FormControl>


      <div>
        <p>Selecione seu Sexo</p>
      <select value={value}  onChange={handleSexoChange} defaultValue="Masculino">
          <option value="Feminino">Feminino</option>
          <option value="Masculino">Masculino</option>
          <option value="Outros">Outros</option>
        </select>
        </div>
        <br></br><br></br>
      <div className="container-login-form-btn">
        <button type="submit" className="login-form-btn" onSubmit={handleSubmit}>Entrar</button>
      </div>
      </form>
    </div>
    </div>
    </div>
  );
};

export default App;
